// Actionsheet
export const Actionsheet = {
  defaultProps: {
    size: 'full',
    justifyContent: 'flex-end',
    animationPreset: 'slide'
  }
}; // ActionsheetContent

export const ActionsheetContent = {
  baseStyle: () => ({
    alignItems: 'center',
    px: 2,
    py: 2,
    borderRadius: 'none',
    roundedTop: 20,
    _light: {
      _dragIndicator: {
        bg: 'muted.500'
      }
    },
    _dark: {
      _dragIndicator: {
        bg: 'muted.400'
      }
    },
    _dragIndicator: {
      height: 1,
      width: 10,
      borderRadius: 2
    },
    _dragIndicatorWrapper: {
      pt: 3,
      pb: 3,
      mt: -2,
      width: '100%',
      alignItems: 'center',
      collapsable: false
    },
    _dragIndicatorWrapperOffSet: {
      py: 2,
      collapsable: false
    }
  })
}; // ActionsheetItem

export const ActionsheetItem = {
  baseStyle: () => ({
    width: '100%',
    justifyContent: 'flex-start',
    _stack: {
      space: 4
    },
    p: 4,
    _text: {
      fontSize: 'md',
      fontWeight: 'normal'
    },
    _disabled: {
      opacity: 40
    },
    _light: {
      bg: 'muted.50',
      _icon: {
        color: 'muted.500'
      },
      _text: {
        color: 'text.900'
      },
      _hover: {
        bg: 'muted.200'
      },
      _pressed: {
        bg: 'muted.400'
      },
      _focusVisible: {
        _web: {
          outlineWidth: '0',
          style: {
            boxShadow: "none"
          },
          bg: 'muted.300'
        },
        bg: 'muted.300'
      }
    },
    _dark: {
      bg: 'muted.800',
      _icon: {
        color: 'muted.400'
      },
      _text: {
        color: 'muted.50'
      },
      _hover: {
        bg: 'muted.700'
      },
      _pressed: {
        bg: 'muted.500'
      },
      _focusVisible: {
        _web: {
          outlineWidth: '0',
          style: {
            boxShadow: "none"
          },
          bg: 'muted.600'
        }
      }
    }
  })
};
